def getCostOfCoffee(numberOfCoffees, pricePerCoffee):
    """Calculate the total cost of coffee orders where for every eight coffee, one additional coffee free.
       first i count free coffees & it is j. then i make condition if number of coffees is less than 8 so cost is numberOfCoffees*pricePerCoffee
       . otherwise cost is (numberOfCoffees-j)*pricePerCoffee where j is free coffees."""
    numberOfCoffees = int(numberOfCoffees)
    FreeCoffee = int(numberOfCoffees/8)

    if numberOfCoffees < 8:
        cost= numberOfCoffees*pricePerCoffee

    else:
        cost=(numberOfCoffees-FreeCoffee)*pricePerCoffee


    return float(cost)



