def getCostOfCoffee(numberOfCoffees, pricePerCoffee):
    '''
    according to the given conditions we can say that set includes of 9 coffees out of which you pay for 8 only. thus i used floor divison of numberofCoffees with 9 to get number of sets which we buy. then i used remainder to get the number of single coffees remaining and then calculated the price needed.
    '''
    c=numberOfCoffees//9
    d=c*8
    numberOfCoffees=numberOfCoffees%9
    if(numberOfCoffees>0):
        while(numberOfCoffees!=0):
            d+=1
            numberOfCoffees-=1
    return (d*pricePerCoffee)

